/**
 * Get audio asset by path
 * @param path - Relative path like "bass/bass_sub_C2.wav" or "patterns/bass/bass_sub_arp_up_major_128bpm_2bar.wav"
 * @returns require() result or null if not found
 */
export function getPresetAudio(path: string): any {
  return PRESET_AUDIO_ASSETS[path] || null;
}

/**
 * Check if audio asset exists
 */
export function hasPresetAudio(path: string): boolean {
  return path in PRESET_AUDIO_ASSETS;
}

/**
 * Get all available audio paths
 */
export function getAllAudioPaths(): string[] {
  return Object.keys(PRESET_AUDIO_ASSETS);
}

/**
 * Get stats about loaded assets
 */
export function getAssetStats() {
  const paths = getAllAudioPaths();
  const categories = new Set<string>();
  const patterns = paths.filter(p => p.startsWith('patterns/')).length;
  const samples = paths.length - patterns;
  
  for (const p of paths) {
    const category = p.split('/')[p.startsWith('patterns/') ? 1 : 0];
    categories.add(category);
  }
  
  return {
    total: paths.length,
    samples,
    patterns,
    categories: categories.size,
  };
}
